import { TestBed } from '@angular/core/testing';
import { HttpClientTestingModule } from '@angular/common/http/testing';
import { RegistrationComponent } from './registration.component';
import { RouterTestingModule } from '@angular/router/testing';
import { DatePipe } from '@angular/common';
import { ReactiveFormsModule } from '@angular/forms';
import { By } from "@angular/platform-browser";
describe('RegistrationComponent', () => {
    let component;
    let fixture;
    beforeEach(async () => {
        await TestBed.configureTestingModule({
            imports: [RouterTestingModule, HttpClientTestingModule, ReactiveFormsModule],
            declarations: [RegistrationComponent],
            providers: [DatePipe]
        })
            .compileComponents();
    });
    beforeEach(() => {
        fixture = TestBed.createComponent(RegistrationComponent);
        component = fixture.componentInstance;
        fixture.detectChanges();
    });
    function updateForm2(account) {
        component.regForm.controls['account'].setValue(account);
    }
    it('should create', () => {
        expect(component).toBeTruthy();
    });
    it('should register a user with valid registration data', () => {
        updateForm2("");
        expect(fixture.debugElement.query(By.css('#username-error-msg')).nativeElement.innerHTML).toBe('Account name is required');
    });
});
